import React , { Component } from 'react';
import BlogInfo from './BlogInfo';

class BlogList extends Component{
    render() {
        const {info} = this.props;
        const list = info.map(info => 
            (<BlogInfo info={info} key={info.key}/>)
        );

        return(
            <div>
                {list}
            </div>
        )
    }
}

export default BlogList;
